The platform-independent Unique Constraint model

<pre>
Usage:
Table t=new Table('Customer');
...  
 t.index().forColumn("column1");
 or
 t.index("indexName").forColumn("column1","column2");

The platform-independent Foreign Key Constraint model
<pre> Usage: Table t=new Table('Customer'); ... t.fkey("column1").ref("refTable", "refColumn1")
or compound foreign key: t.fkey("column1","column2").ref("refTable", "refColumn1", "refColumn2");
